    "store": {"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n    \n\n\n\n\n\n    new Tablesort(document.getElementById('coverage-table'));\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Dependencies\n    \n    \n        \n            @angular-extensions/elements : ^10.0.2\n        \n            @angular/common : ~10.1.0\n        \n            @angular/compiler : ~10.1.0\n        \n            @angular/core : ~10.1.0\n        \n            @angular/elements : ^10.1.0\n        \n            @angular/flex-layout : ^10.0.0-beta.32\n        \n            @angular/platform-browser : ~10.1.0\n        \n            @angular/platform-browser-dynamic : ~10.1.0\n        \n            @ng-bootstrap/ng-bootstrap : ~7.0.0\n        \n            @ngx-translate/core : ^13.0.0\n        \n            @ngx-translate/http-loader : ^6.0.0\n        \n            @popperjs/core : ^2.4.4\n        \n            @auth0/angular-jwt : ^5.0.1\n        \n            bootstrap : ^4.5.2\n        \n            jquery : ^3.5.1\n        \n            rxjs : ~6.6.0\n        \n            tslib : ^2.0.0\n        \n            zone.js : ~0.10.2\n    \n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nMicro Frontend Base\nThis is an Angular template to be used to build Micro Frontends based on Angular Elements. \nIt includes the following capabilities:\n\nAngular v10\ni18n using ngx-translate ngx-translate\nSecurity capabilities using @auth0/angular-jwt\nWeb Components interaction using @angular-extensions/elements\nIncluded @ng-bootstrap/ng-bootstrap\nSingle-bundle package using ngx-build-plus\nMock Server to expose APIs\n\nHow to use it?\nSet the micro frontend name first\nThis template uses \"microfrontend-base\" as micro frontend name in all the files where is necessary, for instance, environments,\nangular.json, etc...\nSo, the first step is to perfom a replace all of \"microfrontend-base\" in all the files. You can do it using your IDE or by\ncommand line. It's up to you.\nDevelopment lifecycle\nBuilding a micro frontend isn't different from building an application. So, there are several scripts in package.json file similar to \nevery Angular application:\n\nstart (and watch): initializes the mock server in port 3000 and the micro frontend in port 4200\nbuild: builds the development version of the micro frontend\nbuild:prod: builds the production version of the micro frontend. The output is located in 'dist' folder\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
